import React from "react";
import axios from "axios";
import * as handleSignout from '../App.js';
// 아이디 닉네임 비밀번호 비밀번호 확인 이름 휴대폰

export default function MyProfileModal({ myProfileModalOff }) {
  const myinfo = () => {
    axios.get('https://localhost/auth').then((res) => {
      console.log(res);
    })
  }
  return (
    <div className="modal">
      <div className="close-btn" onClick={myProfileModalOff}>
        X
      </div>
      <div onClick={myinfo}>회원 정보</div>
      <div>사진</div>
      <fieldset>
        <span>이름{}</span>
      </fieldset>
      <fieldset>
        <span>이메일{}</span>
      </fieldset>
      <fieldset>
        <input className="info-modal-list" type="text"  placeholder="password"></input>
      </fieldset>
      <fieldset>
        <input className="info-modal-list" type="text"  placeholder="password confrim"></input>
      </fieldset>

      <fieldset>
        <input className="info-modal-list" type="number" type="text"  placeholder="phone"></input>
      </fieldset>
      <button className="modal-btn">회원정보 수정</button>
      <div id="myinfo-btn2">
      <span className="myinfo-btn" onClick={() => handleSignout}><a href={'/'}>로그아웃</a></span>
      <span> / </span>
      <span className="myinfo-btn">회원탈퇴</span>
      </div>
    </div>
  );
}
